import React from 'react';
import './index.css';

function NumIncrement(){
  console.log ('clicked');
}

function App(){
    return (
        <React.Fragment>        
        <h1 className='heading_style'>0</h1>
        <button onMouseEnter={NumIncrement}>Click Me</button>
      </React.Fragment>
    )
}

export default App;
